  const { openTooltip, closeTooltip, activeTooltip } = useContext(TooltipContext);

  const handleMouseOver = () => {
    if (activeTooltip !== id) {
      openTooltip(id);
    }
  };

  const handleMouseOut = () => {
    closeTooltip();
