There are several ways a web application can communicate between two browser tabs:

### 1. **Local Storage**

You can use the `localStorage` API to store data in one tab and retrieve it in another. This method is simple, but it has limitations, such as data size limits and the fact that data is not updated in real-time.

**Example:**
```javascript
// Tab 1
localStorage.setItem('data', 'Hello, world!');

// Tab 2
const data = localStorage.getItem('data');
console.log(data); // Output: "Hello, world!"
```
### 2. **Cookies**

Similar to local storage, you can use cookies to store data in one tab and retrieve it in another. However, cookies have additional security concerns and are sent with every request to the server.

**Example:**
```javascript
// Tab 1
document.cookie = 'data=Hello, world!';

// Tab 2
const cookies = document.cookie.split(';');
const data = cookies.find(cookie => cookie.startsWith('data=')).split('=')[1];
